  [],\n\t\"revision_timestamp\": \"2015-05-07T00:57:29.783716\",\n\t\"name\": \"low-cost-high-performance-hall-thruster-support-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Colorado Power Electronics is in the process
  of completing NASA SBIR contract NNC07CA12C Wide Output Range Power Processing Unit
  for Electric Propulsion.  At the end of the project, we will have a complete brassboard
  PPU except for the Digital Control and Interface Unit (DCIU) and Flow Control Driver.
  \ The brassboard PPU meets the electrical requirements of the project, but the specific
  mass is about 20&#37; too low compared to the first bullet of the solicitation.
  \ Preliminary results from testing a 4 kW discharge supply show that the full-power
  efficiency ranges from 94&#37; to 96&#37;. rnThis proposal is to:rn(1)tDetermine
  ways to reduce the mass of the brassboard PPUrn(2)tEvaluate the brassboard PPU to
  determine robustness improvements to be implemented in Phase II.rn(3)tDetermine
  requirements for a DCIU to be implemented in Phase II.rn(4)tDesign and build a brassboard
  Flow Control Driverrn(5)tGain experience in controlling  gas flowrnrnThe Flow Control
  Driver will be designed to control a xenon gas flow system selected by NASA.  The
  DCIU design will be based on requirements received from NASA.  rnrnThe significance
  of this project is that it makes improvements to an innovative and promising PPU
  technology, moving it closer to a flight-ready product, while also facilitating
  NASA research with advanced flow controls.rn\",\n\t\"license_title\": \"U.S. Government
